import './App.css';
import Navbar from './components/Navbar.js';

function App() {
  return (
    <div className="App">
      <Navbar />
      <img src="maqure\maqure-high-resolution-color-logo.jpg" alt="" width="100rem" height="30 rem" className="align-text-top" />
    </div>
  );
}

export default App;
